import React, {Component} from 'react';
import "./add-button.css";

export default class AddTodoListItem extends Component {



    render() {

        return(

            <button
                type="button"
                className="btn btn-outline-secondary"
                onClick={this.props.onItemAdded()}
            >
                Add goal
            </button>

        )
    }
    }
